Prague

Travel Documentary hosted by Craig Sechler, published by National Geographic broadcasted as part of NG Access 360 World Heritage series in 2014 - English narration


Information
------------------------------

What does it take to safeguard the world's most famous places? How do you maintain buildings that are thousands of years old? How do you secure a historical structure that contains millions of dollars worth of artifacts? In this new series, we take you on an exclusive, all-access tour behind the scenes of select UNESCO World Heritage Sites to illuminate the work that goes into running and maintaining these treasured monuments, buildings, national parks and even entire cities, ensuring that they survive in the best possible conditions for future generations to enjoy. 
Access 360 World Heritage: Prague
The ancient castles and cathedrals of Prague draw millions of tourists every year-- and beneath the city is a hidden underworld that traces the story of this UNESCO World Heritage site through the ages. But time and the forces of nature are threatening to destroy what has survived for over a thousand years. Now, teams of explorers, engineers and master craftsmen must go inside Prague's secret spaces to safeguard its cherished heritage.

